BEHAVIORAL_DETAILS_SOCIAL_MESSAGE = "La conducta que has mostrado últimamente al comunicarte no es acorde con la que suelen utilizar la mayoría de los jugadores de World of Warcraft.\n\nHemos recibido varios informes relativos al lenguaje que utilizas y, si la cosa sigue así, es posible que te revoquemos algunos privilegios o suspendamos temporalmente tu cuenta.\n\nQueremos que nos ayudes a hacer de la comunidad de World of Warcraft un sitio mejor y, para ello, te pedimos que muestres una actitud positiva, sin utilizar mensajes ofensivos, discriminatorios, obscenos o molestos.";
