BEHAVIORAL_DETAILS_TY_MESSAGE = "Gracias por tu informe. Los jugadores que incumplen nuestras políticas empeoran la experiencia de World of Warcraft para todos, e informes como el que nos has enviado nos ayudan a identificarlos.\n\nAunque no podemos ofrecerte detalles concretos sobre las sanciones impuestas a otras cuentas, queremos que sepas tus informes nos han llevado a tomar medidas contra un jugador y su cuenta.\n\nTu colaboración hace de World of Warcraft un lugar más amigable para todos.";
