HELPFRAME_REPORT_ABUSE_HELP = "La seguridad y el bienestar de nuestros jugadores nos resultan de vital importancia. Si descubre que un jugador se comporta de manera ofensiva hacia a usted o hacia otros, o que su personaje tiene un nombre que incumple nuestras Condiciones de Uso, podrá expresar su preocupación a través de un método rápido. Si hace clic con el botón derecho del ratón sobre el nombre de un jugador en el chat y selecciona Informar de jugador, podrá notificar sobre los jugadores de una forma rápida y eficaz.";
HELPFRAME_REPORT_BUG_TEXT1 = "Si has encontrado un error, necesitaremos todos los detalles posibles para encontrarlo y corregirlo. Describe el problema en el campo de texto:\n\n-|cffffd200Sé específico|r sobre cada uno de los pasos que provocan el problema.\n-Incluye cualquier |cffffd200nombre de personaje, PNJ y lugar|r relevantes.\n-|cffffd200Evita las erratas y las abreviaciones|r: esto hace más difícil encontrar los errores.\n-Incluye |cffffd200desde cuándo|r ves este problema y |cffffd200con qué frecuencia|r (si lo has visto más de una vez).";
