NEWBIE_TOOLTIP_HONORABLE_KILLS = "Cada vez que tú o tu grupo causa daño a un jugador en JcJ que termine muriendo obtendrás puntos por muerte con honor. Solo obtendrás puntos por muerte con honor si acabas con jugadores de dificultad color verde o superior (lo equivalente a los monstruos que te dan experiencia). Las muertes con honor solo las obtendrás al acabar con jugadores enemigos.";
NEWBIE_TOOLTIP_HONOR_CONTRIBUTION_POINTS = "Ganas honor matando con honor durante los combates entre jugadores (JcJ). La cantidad de honor que ganas por muerte depende del daño que tú (o tu grupo) infligiste al jugador eliminado. Cuanto más daño le inflijas, más honor recibirás. El honor conseguido se dividirá entre los miembros del grupo o la banda. Además, ganarás menos honor si ganas al mismo jugador una y otra vez en poco tiempo. Así que tras matar al mismo jugador varias veces, recibirás mucho menos o dejarás de recibir honor.";
NEWBIE_TOOLTIP_HONOR_STANDING = "La Posición es tu puntuación comparada con todos los demás jugadores de tu bando (Horda o Alianza). Si tu posición es 150, entonces tienes a 149 jugadores delante que obtuvieron más honor durante el mismo período de tiempo. Para subir en posición y rango debes conseguir al menos 15 muertes con honor.";
