TUTORIAL1 = "Los personajes con misiones tienen un símbolo de exclamación sobre la cabeza. Para hablarles, acércate y haz clic derecho sobre ellos.";
TUTORIAL10 = "Puedes colocar bolsas en los huecos vacíos que hay en la parte inferior derecha de la pantalla, al lado de la mochila. Después, haz clic en ellas para abrirlas.";
