TUTORIAL11 = "Para regenerar tu salud más rápido puedes comer. Haz clic en el icono de la comida de la barra de acción en la parte inferior izquierda de la pantalla. De todas maneras, durante el combate no puedes comer.";
TUTORIAL11_DWARF = "¡Derrota a más |cffffd200invasores Comepiedras|r!";
TUTORIAL11_GNOME = "¡Derrota a más |cffffd200gnomos parias enloquecidos|r!";
TUTORIAL11_NIGHTELF = "¡Derrota a más |cffffd200sables de la noche jóvenes|r!";
