TUTORIAL12 = "Para recuperar rápidamente tu maná puedes beber. Haz clic en el icono de beber, en la barra de acción de la parte inferior de la pantalla. La regeneración de maná se detendrá si utilizas otra facultad o entablas combate.";
TUTORIAL13 = "Para aprender nuevos talentos existe una interfaz especial. Abre la página de talentos haciendo clic sobre el botón intermitente de la barra de acción.";
TUTORIAL14 = "Dirígete a tu instructor en la zona de inicio para aprender una nueva habilidad. Aunque antes tendrás que encontrarlo.";
TUTORIAL15 = "Para mover hechizos y facultades a tu barra de acción, abre la página de acción pulsando el botón que se encuentra en la parte inferior central de la pantalla y luego arrastra el icono de facultad hasta tu barra de acción. También puedes usar un hechizo o una facultad de la página de facultades haciendo clic en su icono.";
TUTORIAL16 = "Para ver tu reputación con los diferentes grupos del mundo, abre el panel del personaje y visualiza la pestaña de reputación.";
TUTORIAL17 = "Para responder a ese jugador, pulsa la tecla R y escribe el mensaje, o escribe /contar <nombrejugador> y después el mensaje.";
TUTORIAL18 = "Puedes invitar a otros jugadores a unirse a tu grupo haciendo clic derecho sobre su retrato y seleccionando la opción del menú desplegable.";
TUTORIAL19 = "Esa es otra persona de verdad jugando con su personaje. Te puedes dar cuenta de ello porque su nombre está en azul.";
TUTORIAL1_DWARF = "Los asignadores de misiones tienen puntos de exclamación (|TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0|t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Joren Cargacero|r.|n|nPara hablar con |cffffd200Joren Cargacero|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_GNOME = "Los asignadores de misiones tienen puntos de exclamación (|TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0|t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Nevin Tuercellave|r.|n|nPara hablar con |cffffd200Nevin Tuercellave|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_HUMAN = "Los asignadores de misiones tienen puntos de exclamación (|TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0|t) sobre la cabeza. Puedes aceptar una misión si hablas con el |cffffd200alguacil McBride|r.|n|nPara hablar con el |cffffd200alguacil McBride|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_NIGHTELF = "Los asignadores de misiones tienen puntos de exclamación (|TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0|t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Ilthalaine|r.|n|nPara hablar con |cffffd200Ilthalaine|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_ORC = "Los asignadores de misiones tienen puntos de exclamación (|TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0|t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Kaltunk|r.|n|nPara hablar con |cffffd200Kaltunk|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_SCOURGE = "Los asignadores de misiones tienen puntos de exclamación (|TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0|t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Agatha|r.|n|nPara hablar con |cffffd200Agatha|r tienes que |cffffd200hacer clic derecho|r sobre ella.";
TUTORIAL1_TAUREN = "Los asignadores de misiones tienen puntos de exclamación (|TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0|t) sobre la cabeza. Puedes aceptar una misión si hablas con el |cffffd200jefe Viento de Halcón|r.|n|nPara hablar con el |cffffd200jefe Viento de Halcón|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL1_TROLL = "Los asignadores de misiones tienen puntos de exclamación (|TInterface\\OptionsFrame\\UI-OptionsFrame-NewFeatureIcon:0|t) sobre la cabeza. Puedes aceptar una misión si hablas con |cffffd200Jin'thala|r.|n|nPara hablar con |cffffd200Jin'thala|r tienes que |cffffd200hacer clic derecho|r sobre él.";
TUTORIAL2 = "Puedes moverte mediante las teclas A, S, D y W, con las flechas de dirección, o pulsando continuamente los botones izquierdo y derecho del ratón.";
TUTORIAL20 = "Si haces clic derecho sobre un objeto en la ventana de un mercader comprarás ese objeto, siempre que tengas dinero suficiente. Asimismo, si tienes la ventana del mercader abierta, también puedes hacer clic derecho en los objetos de tu mochila para vendérselos.";
TUTORIAL21 = "Puedes abrir el registro de misiones para ver una haciendo clic en el cáliz dorado que hay en medio de la barra que hay en la parte inferior de la pantalla.";
TUTORIAL22 = "Si has disfrutado jugando con otro jugador, añádelo a tu lista de amigos. Haz clic en el botón social y añádelo a tu lista de amigos.";
TUTORIAL23 = "Para enviar un mensaje pulsa la tecla Intro y escribe algo. Los jugadores que estén cerca oirán lo que digas.";
TUTORIAL24 = "Estos objetos los puedes equipar desde la pantalla de tu personaje. Para acceder a ella pulsa el botón inferior central con el rostro del personaje y arrastra los objetos para equipar desde tu bolsa hasta tu jugador.";
TUTORIAL25 = "Ahora eres un fantasma. Podrás volver a la vida si encuentras tu cuerpo o si te diriges a un Ángel de la Resurrección que esté cerca. Tu cadáver se muestra como un icono en el minimapa de la esquina superior derecha de la pantalla.";
TUTORIAL26 = "Te sientes descansado. Esto te otorga un bonus temporal de experiencia cuando matas monstruos.";
TUTORIAL27 = "Cuando te sumerjas en aguas profundas e ignotas aparecerá una barra de fatiga. Cuando esa barra se vacíe, comenzarás a ahogarte.";
TUTORIAL28 = "Nadar es como caminar, excepto por la posibilidad de ir hacia arriba o abajo presionando el botón derecho del ratón y mirando en la dirección que quieres seguir.";
TUTORIAL29 = "Cuando tu personaje se sumerja en el agua, aparecerá la barra Aire. Si te quedas sin aire, comenzarás a ahogarte.";
TUTORIAL3 = "Si presionas y no sueltas el botón izquierdo del ratón puedes girar la vista de la cámara. Dejando presionado el botón derecho podrás girar al personaje y la visión al mismo tiempo.";
TUTORIAL30 = "Tu retrato brilla en color amarillo, así que estás descansando. El tiempo que pases descansando o desconectado te da un bonus de experiencia para matar monstruos. Quizás quieras buscar un posadero y conseguir una piedra de hogar que te permitirá volver rápidamente después.";
TUTORIAL31 = "Ahora tienes una piedra de hogar. Estas se pueden usar para teletransportarte de tu ubicación actual a la última posada en la que has obtenido tu piedra. Solo podrás usar la piedra de hogar una vez por hora.";
TUTORIAL32 = "Te estás enzarzando en combate Jugador contra Jugador. En este modo de combate, aparecerá un símbolo de tu alianza al lado de tu retrato y los jugadores enemigos te podrán atacar.";
TUTORIAL33 = "Pulsa la barra espaciadora para que tu personaje salte. Salta para superar obstáculos y también si no consigues salir del agua a tierra firme.";
TUTORIAL34 = "Acabas de completar tu primera misión. Para recoger la recompensa, tu personaje debe volver hasta la persona que le encomendó la misión. Tras completar una misión, verás al que te la ha dado en el minimapa (siempre que estés cerca).";
TUTORIAL35 = "Has hecho clic sobre un maestro de vuelo, que doma aves voladoras para el transporte de personas de un lugar a otro. Por una módica suma, podrás volar rápidamente hasta otros maestros de vuelo con los que hayas interactuado anteriormente. Cuando descubras nuevas ciudades, busca a los maestros de vuelo para poder llegar allí volando rápidamente en futuras ocasiones.";
TUTORIAL36 = "Uno de tus objetos está perdiendo durabilidad. El icono de armadura situado debajo del minimapa muestra en amarillo las partes dañadas. Busca a un mercader local para repararlo antes de que se rompa.";
TUTORIAL37 = "¡Uno de tus objetos se ha roto! El icono de la armadura, debajo del minimapa, indica el objeto roto en color rojo. Para repararlo, acude a algún mercader en una aldea. Hasta que lo hagas, no sacarás partido alguno de ese objeto.";
TUTORIAL38 = "Tu personaje puede aprender hasta dos profesiones que te ayudarán a encontrar o crear valiosos objetos. Si quieres aprender más sobre las profesiones, pregúntale a un guardia de una ciudad importante cómo llegar hasta los instructores.";
TUTORIAL39 = "Puedes invitar a otros jugadores a unir fuerzas contigo para derrotar enemigos con más facilidad. Muchas misiones difíciles se completan fácilmente en grupo y el crédito de la misión se divide entre sus miembros. Además, los grupos ganan bonus de experiencia que los jugadores en solitario no.";
TUTORIAL4 = "Con clic izquierdo seleccionas un objeto y con clic derecho interactúas con él.";
TUTORIAL40 = "¡Has aprendido un hechizo o una habilidad nueva! Usa el botón Libro de hechizos y habilidades que encontrarás en la barra de acción para abrir el libro de hechizos. Haz clic con el botón izquierdo del ratón y arrastra un hechizo o una habilidad para moverlo a la barra de acción. El libro de hechizos está organizado por categorías, tal y como indican las pestañas que sobresalen de la parte derecha del libro.";
TUTORIAL41 = "Has aceptado una misión de élite. Estas misiones se resuelven mejor en grupo, ya que te llevarán a regiones habitadas por criaturas de élite también. Estas criaturas son bastante más fuertes que los monstruos normales. Sin embargo, también ganarás más experiencia si las derrotas. Reconocerás a una criatura de élite por el marco dorado de dragón que rodea su retrato.";
TUTORIAL42 = "Siempre que te topes con algo nuevo, aparecerá el botón de ayuda en la parte central inferior de la pantalla. Haz clic sobre él para ver una breve explicación de cómo interactuar con esa parte del mundo. Estos consejos serán muy básicos al empezar y se harán más específicos a medida que ganes experiencia.\n\nMuchas gracias por jugar. ¡Te deseamos buena suerte en tus aventuras!";
TUTORIAL43 = "Un PNJ con un signo \"!\" sobre la cabeza tiene una misión para la que se requiere un nivel superior al tuyo. Vuelve a intentarlo cuando hayas ganado algunos niveles.";
TUTORIAL44 = "Te has hecho con un arma a distancia. Para usarla debes equiparla y después abrir tu libro de hechizos y arrastrar la facultad Disparar o Lanzar hasta tu barra de acción.";
TUTORIAL45 = "No puedes disparar arcos o armas de fuego sin munición. Para comprar munición, busca a un mercader de armas o arcos en la ciudad. Para cargar la munición haz clic derecho sobre ella.";
TUTORIAL46 = "Te has unido a una banda: es un grupo con un límite superior de hasta 40 personas.\n\n|cffff2020Mientras estés en una banda, no obtendrás puntos por misiones que no sean de banda al matar criaturas o recoger objetos.|r";
