VOICEMACRO_19_Dw_4_FEMALE = "Ya basta de flirtear. Sé que piensas que todas las enanas somos iguales.";
VOICEMACRO_19_Dw_5 = "Debo de estar soñando porque eres un sueño hecho realidad. Además, me siento húmedo.";
VOICEMACRO_19_Gn_0 = "Tengo un par de inventos en casa que me gustaría mostrarte.";
VOICEMACRO_19_Gn_0_FEMALE = "Qué monada.";
VOICEMACRO_19_Gn_1 = "Es curioso lo guapo que me ven algunas cuando van ciegas de cerveza.";
