VOICEMACRO_19_Sc_5 = "No te preocupes por la baba. No es más que líquido para embalsamar.";
VOICEMACRO_19_Sc_5_FEMALE = "No hay nadie mejor que yo… cuando se trata de jugar con la muerte.";
VOICEMACRO_19_Ta_0 = "Me conmueves.";
