VOICEMACRO_19_Ta_4_FEMALE = "¿Te gustaría ver un buen baile en zuecos?";
VOICEMACRO_19_Ta_5 = "¿Se te dan bien las máquinas complicadas?";
VOICEMACRO_19_Tr_0 = "¿Quieres un poco de amor de la jungla?";
VOICEMACRO_19_Tr_0_FEMALE = "Lo sé. Mi belleza natural intimida.";
VOICEMACRO_19_Tr_1 = "Nosotros, los trols, nos emparejamos para toda la vida. Eso sí, nos encanta reencarnarnos a cada rato.";
VOICEMACRO_19_Tr_1_FEMALE = "Cuando siente cólera, o entra en celo, una hembra trol se puede aparear unas ochenta veces por noche. ¿Preparado tú?";
