VOICEMACRO_20_Tr_4 = "Mato dos enanos por la mañana y por la noche otros dos. Mato dos enanos por la tarde y ya me siento mejor. Mato dos enanos en tiempos de paz y otros dos en tiempos de guerra. Mato dos enanos antes de matar dos enanos y justo después otros dos.";
